import React from "react";
import TrackList from "../trackList/trackList";
import "./artist.scss";

class Artist extends React.Component {
  render() {
    return (
      <>
        <TrackList
          data={this.props.data_content.recently}
          play={this.props.play_content}
        ></TrackList>
        <TrackList
          data={this.props.data_content.all}
          play={this.props.play_content}
        ></TrackList>
      </>
    );
  }
}

export default Artist;
